import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const Login = () => {
  const navigate = useNavigate();

  const fetchDataFromGoogleSheets = async () => {
    var myHeaders = new Headers();
    myHeaders.append("Content-Type", "application/json");

    var requestOptions = {
      method: "GET",
      headers: myHeaders,
      redirect: "follow",
    };

    try {
      const response = await fetch("https://v1.nocodeapi.com/emircankocatepe/google_sheets/HILItNTkYdoXLExR?tabId=Sayfa1&row_id=2", requestOptions);
      const result = await response.json();
      console.log(result);
    } catch (error) {
      console.error('Error fetching data from Google Sheets:', error);
    }
  };

  const handleLogin = async () => {
    // Your login logic here
    // After successful login:
    await fetchDataFromGoogleSheets();
    navigate('/mainpage'); // Navigate to the main page after login
  };

  return (
    <div>
      <h1>Login</h1>
      <button onClick={handleLogin}>Log In</button>
    </div>
  );
};

export default Login;
